// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract SimpleInterestRateStrategy {
    using SafeMath for uint256;

    uint256 public constant OPTIMAL_UTILIZATION_RATE = 80 * 1e16; // 80%
    uint256 public constant EXCESS_UTILIZATION_RATE = 20 * 1e16;  // 20%

    uint256 public immutable baseRate;
    uint256 public immutable slope1;
    uint256 public immutable slope2;

    constructor(uint256 _baseRate, uint256 _slope1, uint256 _slope2) {
        baseRate = _baseRate;   // Base borrow rate when utilization = 0 // 0.05%
        slope1 = _slope1;       // Slope for utilization â‰¤ optimal // //0.01%
        slope2 = _slope2;       // Slope for utilization > optimal // 0.05%
    }

    function calculateBorrowRate(
        uint256 availableLiquidity,
        uint256 totalBorrows
    ) external view returns (uint256 borrowRate) {
        uint256 utilization = (totalBorrows == 0) ? 0 : (totalBorrows * 1e18) / (availableLiquidity + totalBorrows);

        if (utilization <= OPTIMAL_UTILIZATION_RATE) {
            borrowRate = baseRate + (utilization * slope1) / OPTIMAL_UTILIZATION_RATE;
        } else {
            uint256 excessUtilization = utilization - OPTIMAL_UTILIZATION_RATE;
            borrowRate = baseRate + slope1 + (excessUtilization * slope2) / EXCESS_UTILIZATION_RATE;
        }

    }
}

